def test_login_empty():
     response = requests.post("http://localhost:5000/auth/login",{})
     print(response.json()['status'])
     assert response.status_code == 400
     assert response.json()['status'] == 'fail'


def test_login_wrong():
    response = requests.post("http://localhost:5000/auth/login", json={'username':'charbel@gmail.com','password':'wrong','role':'user'})
    assert response.status_code == 400
    assert response.json()['status'] == 'fail'

def test_register_wrong():
    response = requests.post("http://localhost:5000/auth/register", json={})
    assert response.status_code == 400
    assert response.json()['status'] == 'fail'


def test_login_correct():
    response = requests.post("http://localhost:5000/auth/login", json={'username':'charbel@gmail.com','password':'password','role':'user'})
    assert response.status_code == 400
    assert response.json()['status'] == 'fail'
